import React from 'react';
import {Row, Container} from 'react-bootstrap'
import Tarjeta from '../Home/Tarjeta';


export default function Directorio() {
  return (
      <div className='content-wrapper'>
          <section className='content'>
              <Container fluid>
                  <Row>
                    <Tarjeta></Tarjeta>
                    <Tarjeta></Tarjeta>
                    <Tarjeta></Tarjeta>
                  </Row>
              </Container>
          </section>
      </div>
  );
}
